import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";

function HomePage(props) {
  let data = [
    {
      value: "There are total 10 quetions",
    },
    {
      value: "1 min for each quetion.",
    },
    {
      value: "Make sure you have good internet connection",
    },
  ];
  const [fields, setFields] = useState([]);

  useEffect(() => {
    fetch("http://127.0.0.1:3000/instructions")
      .then((res) => res.json())
      .then((results) => {
        setFields(results);
      });
  }, []);

  return (
    <div className="container">
      <div className="box2">
        <h2>Instructions</h2>
        {data.map((field, idx) => {
          return (
            <div key={`${idx}`}>
              <div>{`${idx + 1}. ${field.value}`}</div>
            </div>
          );
        })}
        <button className="startbtn">
          <Link to="/test"> Start Test</Link>
        </button>
      </div>
      <Link to="customtest">Make Your Own Custom Test</Link>
    </div>
  );
}

export default HomePage;
